let loadArtefacts = () => {
    for (let artefact of artefactsList) {
        if (artefact.imageData != undefined && artefact.imageData != "") {
            ImageData.fromBase64Alt(function (i) {
                artefact.image = i;
                artefact.slicedImage = i.data.slice(sliceArtefacts * 4 * 34, i.data.length);
            }, artefact.imageData);
        }
    }
}

let compareArtefacts = (slot) => {
    let slicedImg = slot.buffer.data.slice(sliceArtefacts * 4 * 34, slot.buffer.data.length);

    for (let artefact of artefactsList) {
        if (artefact.image != undefined) {
            let imgToCompare = artefact.slicedImage;

            let diff = pixelmatch(imgToCompare, slicedImg, null, 34, 34 - sliceArtefacts, {threshold: 0.05});
            
            if (diff < 30) {            
                if (artefact.name.match(/.*Spell Scroll.*/)) {
                    if (diff < 10) {
                        console.log(diff + ' ' + artefact.name)
                        artefactsCount.push({
                            name: artefact.name,
                            qty: slot.amount
                        });
                        return artefact.name;
                    }
                } else {
                    console.log(diff + ' ' + artefact.name)
                    artefactsCount.push({
                        name: artefact.name,
                        qty: slot.amount
                    });
                    return artefact.name;
                }

            }
        }
    }
}